var Configure = require('./../conf/configure'),
    MapValue = require('./../value/map-value'),
    PropertyUtil = require('./../util/property-util')

module.exports = {
    update: function(m /* MapValue */){

    },
    readConfig: function(){
        var props = Configure.getCustomProps();
        var mv = new MapValue();
        for(var k in props){
            mv.putString(k, props[k]);
        }
        return mv;
    }
}